import React from "react";
import './App.scss';
import fontawesome from '@fortawesome/fontawesome'
import FontAwesomeIcon from '@fortawesome/react-fontawesome';
import { faSearch } from '@fortawesome/fontawesome-free-solid'
export default class Header extends React.Component {
    constructor(props) {
        super ( props );
    }

    render() {
        return (<div
            className={"flex space-between header"}>
            {/*left tabs*/}
            <div className={"flex-center"}>
                <div className={"horizontal-margin-10 bold-white"}><h2>GREATS</h2></div>
                <div className={"horizontal-margin-10 small-white"}><h2>Men</h2></div>
                <div className={"horizontal-margin-10 small-white"}><h2>Women</h2></div>
            </div>
            {/*right tabs*/}
            <div className={"flex-center"}>
                <div className={"horizontal-margin-10"}><a className={"small-white"} href={'#'}><h2>Our Story</h2></a></div>
                <div className={"horizontal-margin-10"}><a className={"small-white"} href={'#'}><h2>Visit Us</h2></a></div>
                <div className={"horizontal-margin-10"}><a className={"small-white"} href={'#'}><h2>My Account</h2></a></div>
                <div className={"horizontal-margin-10"}><a className={"small-white"} href={'#'}><FontAwesomeIcon icon="search" /></a></div>
                <div className={"horizontal-margin-10"}><a className={"small-white"} href={'#'}><h2>Shopping Cart</h2></a></div>
            </div>
        </div>)
    }
}
